import PropTypes from 'prop-types';
import styles from './MyButton.module.scss';

export default function MyButton (props) {

  return (
    <div 
      style={props.myButtonStyle}
      className={props.myButton}
      onClick={props.handleCklick}
    >
      {props.name}
    </div>
  )
}

